import React from "react";

export default class Menu extends React.Component {

    render() {
        return(
            <div className="row">
                <div className="col-12 d-flex align-items-center bg-light fixed-top p-2">
                    <h1> SOCCER PREDICTIONS </h1>
                    <span className="mx-3"> Predictions </span>
                    <span className="mx-3"> PRO Picks </span>
                    <span className="mx-3"> About </span>
                 </div>
            </div>
        )
    }
}
